animal.description:
Sarge is an angel who was returned after 7 months of being adopted. He would do best in a home as an only dog, no cats & absolutely no kids. Sarge is a very smart boy who knows how to sit, lay down, stay. He is housebroken, crate trained & walks well on leash. Sarge would love a home with an active family with a fenced in yard to run around in. He is fully vetted, microchipped & neutered. His furever MUST have tennis balls in it as he LOVES to play fetch. Can you be his forever home?

Adoption fee is $320
Email: dogs@almosthomefoundation.org

Almost Home Foundation's adoption requirements:
(1) Be at least 21 years of age;
(2) Have the consent of all adults living in the household;
(3) Have approval from the residence owner;
(4) Have valid ID with current address;
(5) Be approved by Almost Home Foundation as a suitable adoptive home; and
(6) Live in the Greater Chicago Land area. Illinois only
*** Please note that Almost Home Foundation accepts only cash or checks for adoption fees; we do not accept debit or credit cards. ***
